import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Landing from './routes/Landing'
import Homeglobe from './routes/Homeglobe'
// import Citypage from './routes/Citypage'
import { library } from '@fortawesome/fontawesome-svg-core'
import { faUser, faEnvelope, faKey, faCheck } from '@fortawesome/free-solid-svg-icons'
import axios from 'axios'
import { connect } from 'react-redux'
import { signedIn } from './actions'
import City from './components/City'

library.add(faUser, faEnvelope, faKey, faCheck)

const App = ({ signedIn }) => {

    axios.get('http://localhost:3000/users').then(res => {
        console.log(res.data)
        signedIn(res.data)
    })
    return (
        <Router>
            <Route exact path="/" component={Landing} />
            <Route path="/homeglobe" component={Homeglobe} />
            <Route path="/citypage" component={Citypage} />
        </Router>
    )
}

const mapDispatchToProps = dispatch => {
    return {
        signedIn: id => dispatch(signedIn(id))
    }
}

// function City({ match }) {
//     return <h3>Requested Param: {match.params.id}</h3>;
// }

function Citypage({ match }) {
    return (
        <div>
            <h2>Citypage</h2>

            <ul>
                <li>
                    <Link to={`${match.url}/toronto`}>Toronto</Link>
                </li>
                <li>
                    <Link to={`${match.url}/newyork`}>New york</Link>
                </li>
            </ul>

            <Route path={`${match.path}/:id`} component={City} />
            <Route
                exact
                path={match.path}
                render={() => <h3>Please select a city.</h3>}
            />
        </div>
    );
}



export default connect(null, mapDispatchToProps)(App)
